import React from "react";
import "./Home.css";
import mainImage from "../images/mainImage.svg";
import mobileImage from "../images/mobileImage.svg";
import backgroundMain from "../images/backgroundMain.svg";

const Home = () => {
  return (
    <div className="Home">
      <div className="hero">
        <div className="header"></div>
        <div className="image">
          <img
            className="backgroundMain"
            src={backgroundMain}
            alt="backgroundMain"
          />
          <img className="mobileImage" src={mobileImage} alt="mobileImage" />
          <img className="mainImage" src={mainImage} alt="mainImage" />
        </div>
      </div>
      <div className="subsection1"></div>
      <div className="subsection2"></div>
      <div className="subsection3"></div>
      <div className="subsection4"></div>
      <div className="footer"></div>
    </div>
  );
};

export default Home;
